                      <div>
                        &nbsp;&nbsp;"เหมาะสม"&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;ถ้า&nbsp;+.10&le;
                        <i>
