                      ประสบการณ์การทำงาน ฯลฯ
                      เพื่อประกอบการพิจารณาที่ต้องใช้เวลาและรายละเอียดรอบคอบ
                      ในการวางแผนการเข้ารับราชการของผู้สมัครเข้ารับราชการ
                      <div>
                        <div className="strong1">วิธีที่ 2</div> การใช้
